import React from "react";
import { FaDollarSign, FaUsers, FaMapMarkerAlt } from "react-icons/fa";
import img1 from "../assets/home2.jpeg"; // replace with your image
import img2 from "../assets/home3.jpeg"; // replace with your image

const PropertySection = () => {
  return (
    <div style={styles.propertySection}>
      {/* Images */}
      <div style={styles.imagesContainer}>
        <img src={img1} alt="Property 1" style={{ ...styles.image, zIndex: 0 }} />
        <img src={img2} alt="Property 2" style={{ ...styles.image, ...styles.img2, zIndex: 1 }} />
      </div>

      {/* Content */}
      <div style={styles.contentContainer}>
        <h2 style={styles.heading}>
          We provide latest properties for our valuable clients
        </h2>

        <div style={styles.iconSection}>
          <div style={styles.iconItem}>
            <FaDollarSign style={styles.icon} />
            <div>
              <h3 style={styles.subHeading}>Budget Friendly</h3>
              <p style={styles.paragraph}>Affordable options to suit every budget.</p>
            </div>
          </div>

          <div style={styles.iconItem}>
            <FaUsers style={styles.icon} />
            <div>
              <h3 style={styles.subHeading}>Trusted by Thousand</h3>
              <p style={styles.paragraph}>Thousands of clients trust our services.</p>
            </div>
          </div>

          <div style={styles.iconItem}>
            <FaMapMarkerAlt style={styles.icon} />
            <div>
              <h3 style={styles.subHeading}>Prime Location</h3>
              <p style={styles.paragraph}>Properties located in prime areas.</p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

const styles = {
  propertySection: {
    display: "flex",
    gap: "50px",
    alignItems: "center",
    padding: "50px",
    margin:"auto auto auto 50px",
  },
  imagesContainer: {
    position: "relative",
    width: "300px",
    height: "400px",
  },
  image: {
    position: "absolute",
    width: "100%",
    height: "100%",
    objectFit: "cover",
    borderRadius: "10px",
    boxShadow: "0 5px 15px rgba(0,0,0,0.3)",
  },
  img2: {
    left: "50px",
    top: "20px",
  },
  contentContainer: {
    flex: 1,
    display: "flex",
    flexDirection: "column",
    justifyContent: "center",
    height: "400px",
  },
  heading: {
    
    fontSize: "24px",
    fontWeight: "bold",
  },
  iconSection: {
    display: "flex",
    flexDirection: "column",
    gap: "20px",
  },
  iconItem: {
    display: "flex",
    alignItems: "flex-start",
    gap: "15px",
  },
  icon: {
    fontSize: "30px",
    marginTop: "5px",
    color: "#1e90ff",
  },
  subHeading: {
    margin: 0,
    fontSize: "18px",
  },
  paragraph: {
    margin: 0,
    fontSize: "14px",
    color: "#555",
  },
};

export default PropertySection;
